import styled from "styled-components";

const MainChatChannelNamePresenter = styled.div`
    width: 100%;
    height: 8%;

    border-bottom:solid 1px black;
    display: flex;
    align-items: center;

    padding-left:20px;
    font-size:20px;
`

export default MainChatChannelNamePresenter;
